import React from 'react';
import map from './mapOfLocations.png';
import './App.css';

//cool imports below

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={map} className="App-mapOfLocations" alt="mapOfLocations"/>
        <p>
          Select the companies you plan to visit!
        </p>
      </header>
      <Dropdown>
        <Dropdown.Toggle variant="success" id="dropdown-basic">
            Dropdown Button
        </Dropdown.Toggle>

        <Dropdown.Menu>
            <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
            <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
            <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>

    </div>
  );
}

export default App;
